import React, { useState } from "react";
import "./login.css"


function Login() {
const [login,setLogin]=useState(true);
function chgForm(e){
setLogin(!login)
}

    return (
        <>
        {login?<LoginForm chgForm={chgForm}/>:<SignupForm chgForm={chgForm}/>}
        
        
       
        </>
        
        


        
    )

}
export default Login


function SignupForm(props){

    return (
        <div className="form">
           
        <h4>
            Sign Up
        </h4>
       
        <label>Your Email</label>
        <br />
        <input type="email" />
        <label>Your Password</label>
        <br />
        <input type="password" />
        <br /><br />
        <button>Create account</button>
         <br />
        <p onClick={()=>{
            props.chgForm()
        }}>Login with existing account</p>

    </div>
    

    )
}
